import { Container } from 'react-bootstrap';

export default function Tentang() {
    return (
        <Container>
            <h2>
                Tentang Kami
            </h2>
            <h3>
                Selamat datang di Adlitech! 
            </h3>
            <p class="justify">Kami memiliki keahlian di industri teknologi dan berkomitmen untuk memberikan solusi inovatif. Dengan perhatian pada kepuasan pelanggan, kami siap menjadi mitra terpercaya Anda dalam mencapai tujuan teknologi. 
</p>

        </Container>
    );
}
